// GenSignPoly generates the minimax composite polynomial
func GenSignPoly(prec uint, logalpha int, deg []int) {

	decimals := int(float64(logalpha)/math.Log2(10)+0.5) + 10

	// Precision of the output value of the sign polynmial
	alpha := math.Exp2(-float64(logalpha))

	// Function Sign to approximate
	f := bignum.Sign

	// Maximum number of iterations
	maxIters := 50

	// Scan step for finding zeroes of the error function
	scanStep := bignum.NewFloat(1e-3, prec)

	// Interval [-1, alpha] U [alpha, 1]
	intervals := []bignum.Interval{
		{A: *bignum.NewFloat(-1, prec), B: *bignum.NewFloat(-alpha, prec), Nodes: 1 + (deg[0] >> 1)},
		{A: *bignum.NewFloat(alpha, prec), B: *bignum.NewFloat(1, prec), Nodes: 1 + (deg[0] >> 1)},
	}

	// Parameters of the minimax approximation
	params := bignum.RemezParameters{
		Function:        f,
		Basis:           bignum.Chebyshev,
		Intervals:       intervals,
		ScanStep:        scanStep,
		Prec:            prec,
		OptimalScanStep: true,
	}

	fmt.Printf("P[0]\n")
	r := bignum.NewRemez(params)
	r.Approximate(maxIters, alpha)
	//r.ShowCoeffs(16)
	r.ShowError(decimals)
	fmt.Println()

	coeffs := make([][]*big.Float, len(deg))

	for i := 1; i < len(deg); i++ {

		// New interval as [-(1+/- maxerr)] U [1 +/- maxerr]
		max := bignum.NewFloat(1, prec)
		max.Add(max, r.MaxErr)

		min := bignum.NewFloat(1, prec)
		min.Sub(min, r.MinErr)

		intervals = []bignum.Interval{
			{A: *new(big.Float).Neg(max), B: *new(big.Float).Neg(min), Nodes: 1 + (deg[i] >> 1)},
			{A: *min, B: *max, Nodes: 1 + (deg[i] >> 1)},
		}

		coeffs[i-1] = make([]*big.Float, deg[i-1])
		for j := range coeffs[i-1] {
			coeffs[i-1][j] = new(big.Float).Set(r.Coeffs[j])
			coeffs[i-1][j].Quo(coeffs[i-1][j], max) // Interval normalization
		}

		params := bignum.RemezParameters{
			Function:        f,
			Basis:           bignum.Chebyshev,
			Intervals:       intervals,
			ScanStep:        scanStep,
			Prec:            prec,
			OptimalScanStep: true,
		}

		fmt.Printf("P[%d]\n", i)
		r = bignum.NewRemez(params)
		r.Approximate(maxIters, alpha)
		//r.ShowCoeffs(16)
		r.ShowError(decimals)
		fmt.Println()
	}

	coeffs[len(deg)-1] = make([]*big.Float, deg[len(deg)-1])
	for j := range coeffs[len(deg)-1] {
		coeffs[len(deg)-1][j] = new(big.Float).Set(r.Coeffs[j])
	}

	fmt.Printf("%d:{\n", logalpha)
	for i := range coeffs {
		prettyPrint(decimals, coeffs[i], true, false)
	}
	fmt.Printf("},\n")

	f64, _ := r.MaxErr.Float64()
	fmt.Println(math.Log2(f64))
}

func prettyPrint(decimals int, coeffs []*big.Float, odd, even bool) {
	fmt.Printf("{")
	for i, c := range coeffs {
		if (i&1 == 1 && odd) || (i&1 == 0 && even) {
			fmt.Printf("\"%.*f\", ", decimals, c)
		} else {
			fmt.Printf("\"0\", ")
		}

	}
	fmt.Printf("},\n")
}

func parseCoeffs(coeffsStr []string) (coeffs []*big.Float) {

	var prec uint
	for _, c := range coeffsStr {
		prec = utils.Max(prec, uint(len(c)))
	}

	prec = uint(float64(prec)*3.3219280948873626 + 0.5) // log2(10)

	coeffs = make([]*big.Float, len(coeffsStr))
	for i := range coeffsStr {
		coeffs[i], _ = new(big.Float).SetPrec(prec).SetString(coeffsStr[i])
	}

	return
}

// MaxDepthSignPolys30 returns the maximum depth required among the polys for the required precision alpha.
func MaxDepthSignPolys30(alpha int) (depth int) {
	if polys, ok := SignPolys30[alpha]; ok {

		for _, poly := range polys {
			depth = utils.Max(depth, bits.Len64(uint64(len(poly)-1)))
		}

		return
	}

	panic("invalid alpha")
}

func GetSignPoly30Polynomials(alpha int) (polys []bignum.Polynomial, err error) {
	if coeffsStr, ok := SingPoly30String[alpha]; ok {

		polys = make([]bignum.Polynomial, len(coeffsStr))

		for i := range coeffsStr {

			coeffs := parseCoeffs(coeffsStr[i])

			polys[i] = bignum.NewPolynomial(
				bignum.Chebyshev,
				coeffs,
				&bignum.Interval{
					A: *bignum.NewFloat(-1, coeffs[0].Prec()),
					B: *bignum.NewFloat(1, coeffs[0].Prec()),
				},
			)
		}

		return
	}

	return nil, fmt.Errorf("invalid alpha, should be in [0, 30]")
}

